import  { useEffect } from "react";

export default function App(){

useEffect(()=>{
  fetch("https://www.balldontlie.io/api/v1/teams")
  .then((res)=> res.json())
  .then((data) =>console.log(data.meta.total_count))
},[])



return(<div>{data}</div> )

}
